import { useEffect, useState } from "react";

import "../css/panel.css"

function Cell() {
    const [neighbors, setNeighbors] = useState<[]>([]);

    return(
        <div className="cell">
        </div>
    )
}

export default function Panel() {
    const [grid, setGrid] = useState<typeof Cell[]>();

    useEffect(() => {
        let temp : typeof Cell[] = [];
        for (let i = 0; i < 10; i++) {
            temp.push(Cell)
        }
        setGrid(temp)
    }, [])

    return(
        <div>
            {grid}
        </div>
    );
}
